import React from "react";
import TodoClass from "../models/todo";

const Todo: React.FC<{ todos: TodoClass[] }> = (props) => {
  return (
    <div>
      <ul>
        {props.todos.map((todo) => {
          return <li>{todo.text}</li>;
        })}
      </ul>
    </div>
  );
};

export default Todo;
